import React from 'react';

function AddComments(props) {
    return (
        <div>
            <div className='add-comment'>
                <h3>Add Comment</h3>
                <label>Name
                    <br></br>
                <input type="text" name='username'/>
                </label>
                <label>
                    Comment:
                    <br></br>
                    <textarea rows="4" cols="50" name='comment'></textarea>
                </label>
                <br></br>
                <button>Submit</button>
            </div>
            
        </div>
    );
}

export default AddComments;
